
import type { Resident, RumahCategory } from '../types';

const getCategoryFromNoRumah = (noRumah: string): RumahCategory => {
    const cat = noRumah.charAt(0).toUpperCase();
    if (['A', 'B', 'C', 'D'].includes(cat)) {
        return cat as RumahCategory;
    }
    return 'C';
};

const generatePhoneNumber = (index: number): string => {
    const base = 81234567890;
    const phone = base + index;
    return `62${phone}`;
};


